import "./DummyObjectivePage.css";
import Navbar from "../components/Navbar";
import Carousel from "../components/Carousel";

function DummyObjectivePage() {
    return (
        <div>
            <section>
                <div className="row">
                    <Navbar />
                </div>
                <div className="row">
                    <div className="col carousel-fixed">
                        <Carousel />
                    </div>
                    <div className="col">
                        <h1>Hello</h1>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default DummyObjectivePage;
